def update(arr):
    result = [[" " for q in b] for b in arr]
    changed = False
    for i in range(len(arr)):
        for j in range(len(arr[i])):
            count = 0
            if i + 1 < len(arr) and arr[i + 1][j] == "#":
                count += 1
            if i - 1 >= 0 and arr[i - 1][j] == "#":
                count += 1
            if j + 1 < len(arr[i]) and arr[i][j + 1] == "#":
                count += 1
            if j - 1 >= 0 and arr[i][j - 1] == "#":
                count += 1
                
            if i + 1 < len(arr) and j + 1 < len(arr[i + 1]) and arr[i + 1][j + 1] == "#":
                count += 1
            if i + 1 < len(arr) and j - 1 >= 0 and arr[i + 1][j - 1] == "#":
                count += 1
            if i - 1 >= 0 and j + 1 < len(arr[i - 1]) and arr[i - 1][j + 1] == "#":
                count += 1
            if i - 1 >= 0 and j - 1 >= 0 and arr[i - 1][j - 1] == "#":
                count += 1

            if arr[i][j] == "L" and count == 0:
                result[i][j] = "#"
                changed = True
            elif arr[i][j] == "#" and count >= 4:
                result[i][j] = "L"
                changed = True
            else:
                result[i][j] = arr[i][j]
    return changed, result
    

